self.addEventListener('fetch', e => {
  const thisOrigin = new URL(location.href).origin
  const urlObj = new URL(e.request.url)
  if (urlObj.origin !== thisOrigin || e.request.url.includes('orpheus-pop-')) {
    e.respondWith(fetch(e.request))
    return
  }

  e.respondWith(
    new Response(doc, {
      status: 200,
      statusText: 'OK',
      headers: {
        'Content-Type': 'text/html',
      },
    }),
  )
})
